import React from 'react'
function DsCourseContent() {
  return (
    <div>
               <select>
                 <option value='option1'>Python</option>
                 <option value='option2'>Sql</option>
                 <option value='option3'>Power Bi</option>
               </select>
    </div>
  )
}

export default DsCourseContent
